import { Filter } from './filter/filter-interfaces.js';
export function resultCompoundIdFilter(idField, id, data) {
    return new Filter((add) => {
        let idParts = [];
        if (id != undefined)
            idParts = id.split(',');
        idField.fields.forEach((c, i) => {
            let val = undefined;
            if (i < idParts.length)
                val = idParts[i];
            if (data[c.key] != undefined)
                val = data[c.key];
            add.isEqualTo(c, val);
        });
    });
}
